How to compute frequency for multiple fields using a single pipeline in MongoDB?<p>Is it possible to calculate the frequency of multiple fields with a single query in MongoDB? I can do that with separate <code>$group</code> stages for each field. How can I optimize it and build one pipeline that can do the job for all items?</p>
<p>I have the following pipeline in MongoDB 4.5</p>
<pre><code>{
  $match: {
    field1: { $in: ['value1', 'value2'] },
    field2: { $in: ['v1', 'v2'] },
  }
},
{
  $group: {
    _id: {
      field1: '$field1',
      field2: '$field2'
    },
    frequency: { $sum: 1.0 }
  }
}
</code></pre>
<p>From this, I obtain data like the following:</p>
<pre><code>{ 
  &quot;_id&quot;: {
      &quot;field1&quot;: &quot;value1&quot;, 
      &quot;field2&quot;: &quot;v1&quot;
  }, 
  &quot;count&quot;: 7.0
},
{ 
  &quot;_id&quot;: {
      &quot;field1&quot;: &quot;value1&quot;, 
      &quot;field2&quot;: &quot;v2&quot;
  }, 
  &quot;count&quot;: 3.0
},
{ 
  &quot;_id&quot;: {
      &quot;field1&quot;: &quot;value2&quot;, 
      &quot;field2&quot;: &quot;v1&quot;
  }, 
  &quot;count&quot;: 4.0
}
</code></pre>
<p>The result that I am trying to get is:</p>
<pre><code>{
  &quot;field1&quot;: [
    &quot;value1&quot;: 10.0,
    &quot;value2&quot;: 4.0
  ],
  &quot;field2&quot;: [
    &quot;v1&quot;: 11.0,
    &quot;v2&quot;: 3.0
  ]
}
</code></pre>

