How to get correct Type of a Class using Kotlin,MongoDB and Jsonschema "oneof"<p>We are using an message queue to get some events. These events are described as an json schema like this.</p>
<pre><code>{
  &quot;title&quot;: &quot;Partner&quot;,
  &quot;type&quot;: &quot;object&quot;,
  &quot;properties&quot;: {
    &quot;partnerID&quot;: {
      &quot;type&quot;: &quot;string&quot;,
      &quot;examples&quot;: [
        &quot;0001038645&quot;
      ]
    },
    &quot;partnerTyp&quot;: {
      &quot;type&quot;: &quot;string&quot;,
      &quot;enum&quot;: [
        &quot;NATPERS&quot;,
        &quot;PAAR&quot;,
        &quot;SONST-JURIST&quot;
      ],
      &quot;examples&quot;: [
        &quot;SONST-JURIST&quot;
      ]
    },
    &quot;name&quot;: {
      &quot;oneOf&quot;: [
          &quot;vorname&quot;: {
            &quot;type&quot;: &quot;string&quot;,
            &quot;examples&quot;: [
              &quot;Bernd&quot;
            ]
          },
          &quot;nachname&quot;: {
            &quot;type&quot;: &quot;string&quot;,
            &quot;examples&quot;: [
              &quot;Wernersen&quot;
            ]
          },
        },
        {
          &quot;vorname1&quot;: {
            &quot;type&quot;: &quot;string&quot;,
            &quot;examples&quot;: [
              &quot;Bernd&quot;
            ]
          },
        },
        {
          &quot;nameExtern&quot;: {
            &quot;type&quot;: &quot;string&quot;,
            &quot;examples&quot;: [
              &quot;Internationale Pinsel Manufaktur Gesellschaft mbH&quot;
            ]
          },
        }
      ]
    }
}
</code></pre>
<p><strong>Description</strong></p>
<p>That means we can have three different types of partners which would also result in different classes in kotlin. We want to save them in our database (mongodb).</p>
<p>Later on we want to get them to another application via REST.</p>
<p><strong>Problem</strong></p>
<p>We now have the problem that we do not know how to determine which type we need to save in the database when we are getting the message from the event.</p>
<p>In other Projects we have something like</p>
<p><code>message.getBody(messageClass)</code></p>
<p>But how to get the correct message class with Information in this event ?</p>
<p>And Further more how we get the correct type from the database later on.</p>
<pre><code>interface ContractRepository : MongoRepository&lt;Partner, String&gt; {
    override fun deleteAll()
} 
</code></pre>
<p>Can the Partner be an abstract class and when how does spring data knows whats the correct implemntation to use ?</p>

